using System;
using System.Collections;
using System.Collections.Generic;
using System.IO;
using System.Runtime.Serialization;
using System.Runtime.Serialization.Formatters.Binary;
using CuteEngine.Utilities.Converter;
using UnityEngine;

public class TestBinary : MonoBehaviour
{
    // Start is called before the first frame update
    void Start()
    {
        Test();
    }

    // Update is called once per frame
    void Test()
    {
        MyClass myObject = new MyClass
        {
            Name = "",
        };

        uint a = Convert.ToUInt32(myObject.Name);
        // Serialize the object to a byte array

        // Save the byte array to a file
        File.WriteAllText($"{Application.streamingAssetsPath}/Data/JSONData/Test", a.ToString());
        myObject.SaveData("Test2");
        print("Object saved to file.");
    }
}

[Serializable]
public class MyClass
{
    public string Name { get; set; }


    public void SaveData(string fileName)
    {
        JsonHelper.SaveJSONAsObject(fileName, this, true);
    }
}
